  ASM_SIMP_TAC[GSYM GROUP_POW_ADD] THEN CONV_TAC NUM_REDUCE_CONV THEN
  DISCH_TAC THEN UNDISCH_THEN
   `!P. represents_sm2 P (X8a,Y8a,Z8a)
        ==> represents_sm2 (group_mul sm2_group P P) (Xha,Yha,Zha)`
