let SM2_MONTJSCALARMUL_SUBROUTINE_CORRECT = time prove
 (`!res scalar point n xyz pc stackpointer returnaddress.
        aligned 16 stackpointer /\
        ALL (nonoverlapping (word_sub stackpointer (word 1264),1264))
            [(word pc,0x4834); (res,96); (scalar,32); (point,96)] /\
        nonoverlapping (res,96) (word pc,0x4834)
        ==> ensures arm
             (\s. aligned_bytes_loaded s (word pc) sm2_montjscalarmul_mc /\
                  read PC s = word pc /\
                  read SP s = stackpointer /\
                  read X30 s = returnaddress /\
                  C_ARGUMENTS [res;scalar;point] s /\
                  bignum_from_memory (scalar,4) s = n /\
                  bignum_triple_from_memory (point,4) s = xyz)
             (\s. read PC s = returnaddress /\
                  !P. P IN group_carrier sm2_group /\
                      represents_sm2 P xyz
                      ==> represents_sm2
                            (group_pow sm2_group P n)
                            (bignum_triple_from_memory(res,4) s))
          (MAYCHANGE_REGS_AND_FLAGS_PERMITTED_BY_ABI ,,
           MAYCHANGE[memory :> bytes(res,96);
                     memory :> bytes(word_sub stackpointer (word 1264),1264)])`,
   ARM_ADD_RETURN_STACK_TAC SM2_MONTJSCALARMUL_EXEC
   SM2_MONTJSCALARMUL_CORRECT `[X19; X20; X21; X30]` 1264);;
